/// <summary>
/// Gets the title to display on pages or forms.
/// </summary>
/// <returns>
/// A String that contains the caption to display on forms or pages.
/// </returns>
public str getTitle()
{
    str itemIdandSeperator;

    if (this.ItemId != '')
    {
         itemIdandSeperator = this.ItemId + "-";
    }

    return strFmt("@SYS344437", num2str(this.LineNum, 0, 2, 1, 0 ), itemIdandSeperator, this.itemName());
}

