display PurchRFQCaseId rfqCaseId()
{
    PurchRFQCaseLine    purchRFQCaseLine;
    PurchRFQCaseId      purchRFQCaseId;

    select count(RecId) from purchRFQCaseLine
        where purchRFQCaseLine.AddressRefTableId == tableNum(PurchReqLine) &&
            purchRFQCaseLine.AddressRefRecId == this.RecId;

    if (purchRFQCaseLine.RecId > 1)
    {
        purchRFQCaseId = '*';
    }
    else
    {
        purchRFQCaseId = this.PurchRFQCaseId;
    }
    return purchRFQCaseId;
}

