display VendInvoiceId vendInvoiceId()
{
    VendInvoiceId       ret;

    if (this.PurchLineCreated == NoYes::Yes && this.PurchId)
    {
        if (this.BuyingLegalEntity)
        {
            changecompany(this.buyingLegalEntity2DataArea())
            {
                VendInvoiceJour vendInvoiceJour = VendInvoiceJour::findFromPurchId(this.PurchId);
                ret = vendInvoiceJour.InvoiceId;

                if (ret)
                {
                    VendInvoiceTrans vendInvoiceTrans;
                    InvoiceId internalInvoiceId;

                    select count(RecId) from vendInvoiceTrans
                        where vendInvoiceTrans.LineNum == this.LineNum
                           && vendInvoiceTrans.PurchID == vendInvoiceJour.PurchId
                           && vendInvoiceJour.InternalInvoiceId != internalInvoiceId;

                    if (vendInvoiceTrans.RecId >= 2)
                    {
                        ret += '*';
                    }
                }
            }
        }
    }
    return ret;
}

/// <summary>
/// Gets the vendor name for the display.
/// </summary>
/// <returns>
/// The vendor name.
/// </returns>
/// <remarks>
/// The vendor name that is returned is found by looking up the <c>VendAccount</c> extended data type
/// from the current <c>PurchReqLine</c> record.
/// </remarks>
display PurchReqVendName vendName()
{
    if (this.VendAccount == "")
    {
        return "";
    }
    else
    {
        changecompany(this.buyingLegalEntity2DataArea())
        {
            return VendTable::find(this.VendAccount).name();
        }
    }
}

/// <summary>
/// Provides the vendor status for display.
/// </summary>
/// <returns>
/// The vendor status from the current <c>PurchReqLine</c> record.
/// </returns>
public display PurchReqVendorStatus vendStatus()
{
    PurchReqVendorStatus                purchReqVendorStatus;

    if (this.BuyingLegalEntity && this.ProcurementCategory)
    {
        CompanyInfo legalEntity = CompanyInfo::findRecId(this.BuyingLegalEntity);

        changecompany (legalEntity.DataArea)
        {
    VendProcurementCategoryStatus       vendProcurementCategoryStatus;
    VendCategory                        vendCategory;
    VendTable                           vendTable;

    date                                effectiveDate = DateTimeUtil::getSystemDate(DateTimeUtil::getUserPreferredTimeZone());

            select firstonly validTimeState(effectiveDate) VendorCategoryStatus, RecId from vendProcurementCategoryStatus
            join RecId from vendCategory
                where vendProcurementCategoryStatus.VendorCategory == vendCategory.RecId
                    && vendCategory.VendorAccount   == this.VendAccount
                    && vendCategory.VendorDataArea  == legalEntity.DataArea
                    && vendCategory.Category        == this.ProcurementCategory
            join * from vendTable
                where vendTable.AccountNum  == vendCategory.VendorAccount
                    && vendTable.DataAreaId == vendCategory.VendorDataArea;

            if (vendProcurementCategoryStatus)
            {
                purchReqVendorStatus = enum2str(vendProcurementCategoryStatus.VendorCategoryStatus);
            }
        }
    }
    return purchReqVendorStatus;
}

/// <summary>
/// Finds the specified record in the <c>PurchReqLineHistory</c> table.
/// </summary>
/// <param name="_purchReqLineRecId">
/// A purchase requisition line identifier for which to find the history version.
/// </param>
/// <returns>
/// true if a history exists; otherwise, false.
/// </returns>
static boolean existsHistory(recId    _purchReqLineRecId)
{
    return (select firstonly RecId from purchReqLineHistory where purchReqLineHistory.PurchReqLine == _purchReqLineRecId).RecId != 0;
}

/// <summary>
/// Finds the specified record in the <c>PurchReqLineHistory</c> table.
/// </summary>
/// <param name="_purchReqLineRecId">
/// A purchase requisition line identifier for which to find the history version.
/// </param>
/// <param name="_validDateTime">
/// A date and time for which to find a valid history version.
/// </param>
/// <returns>
/// A record in the <c>PurchReqLineHistory</c> table; otherwise, an empty record.
/// </returns>
public static PurchReqLineHistory find(RefRecId _purchReqLineRecId, utcdatetime _validDateTime = DateTimeUtil::utcNow())
{
    PurchReqLineHistory purchReqLineHistory;

    if (_purchReqLineRecId)
    {
        select firstonly validTimeState(_validDateTime) purchReqLineHistory
            where purchReqLineHistory.PurchReqLine == _purchReqLineRecId;
    }

    return purchReqLineHistory;
}

/// <summary>
/// Finds the specified record in the <c>PurchReqLineHistory</c> table.
/// </summary>
/// <param name="_purchReqLineRecId">
/// A <c>PurchReqLine</c> record identifier for which to find the history version.
/// </param>
/// <param name="_validAsOfDateTime">
/// An instance of the <c>Datetime</c> class to use to find a valid history version.
/// </param>
/// <returns>
/// A record in the <c>PurchReqLineHistory</c> table; otherwise, an empty record.
/// </returns>
public static PurchReqLineHistory findByPurchReqLine(RefRecId _purchReqLineRecId, utcdatetime _validAsOfDateTime = DateTimeUtil::utcNow())
{
    PurchReqLineHistory purchReqLineHistory;

    if (_purchReqLineRecId)
    {
        select firstonly validTimeState(_validAsOfDateTime) purchReqLineHistory
            where purchReqLineHistory.PurchReqLine == _purchReqLineRecId;
    }

    return purchReqLineHistory;
}

/// <summary>
/// Update the specified record's ValidTo field in the <c>PurchReqLineHistory</c> table.
/// </summary>
/// <param name="_purchReqLineRecId">
/// A purchase requisition line identifier for which to update the history version.
/// </param>
static void updateValidTo(RecId _purchReqLineRecId)
{
    PurchReqLineHistory purchReqLineHistory;

    ttsBegin;

    select firstOnly forUpdate * from purchReqLineHistory
        order by ValidTo desc
        where purchReqLineHistory.PurchReqLine == _purchReqLineRecId;

    if (purchReqLineHistory)
    {
        purchReqLineHistory.validTimeStateUpdateMode(ValidTimeStateUpdate::Correction);
        purchReqLineHistory.ValidTo = DateTimeUtil::utcNow();

        purchReqLineHistory.update();
    }

    ttsCommit;
}
